parameters.appletOnLoad = function(api) {
    function addListener(objName) { 
        var descriptionStr = ggbApplet.getDefinitionString(objName);
        var typeOfObject = ggbApplet.getObjectType(objName);
        console.log(objName);
        console.log(descriptionStr);
        if (typeOfObject == "point") {
          
        } else if (typeOfObject == "segment") {
          ggbApplet.setLabelVisible(objName,false);
          ggbApplet.renameObject(objName,`(${descriptionStr})`)
          ggbApplet.setLabelVisible(objName,false);
        } else {
          ggbApplet.renameObject(objName,"("+descriptionStr+")")
        }
    }
	// register add, remove, rename and update listeners
	api.registerAddListener(addListener);
}
